  \"2016-03-08T22:21:31.386684\",\n\t\"name\": \"able-bodied-adults-without-dependents-abawds-rules\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Most SNAP participants who can work, do
  work.  SNAP rules require all recipients meet work requirements unless they are
  exempt because of age or disability or another specific reason. Children, seniors,
  and those with disabilities comprise almost two-thirds of all SNAP participants.
  \ Among households that include someone who is able to work, more than 75 percent*
  had a job  in year before or after receiving SNAP.  Forty-three percent of SNAP
  participants live in a household with earnings.  rnrnSome of these working individuals
  are ABAWDs, or able-bodied adults without dependents.  ABAWDs must meet special
  work requirements, in addition to the general work requirements, to maintain their
  eligibility.rnrnAn ABAWD is a person between the ages of 18 and 49 who has no dependents
  and is not disabled.  ABAWD stands for Able Bodied Adult Without Dependents.\",\n\t\"license_title\":
